import React from "react";
import "./UserSelectBtn.css";

function UserSelectBtn({ id, className, title, clickFct }) {
  return (
    // <div id="buttonContainer">
    <button onclick={clickFct} id={id} className={className}>
      {title}
    </button>
    // </div>
    // {/* <button id="gameButton2">Join Lobby</button> */}
  );
}

export default UserSelectBtn;
